import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getSkills } from "../../actions/skills";
import { getProjects } from "../../actions/projects";
import { PrimaryOutlineButtonWithIcon } from "../../components/PrimaryOutlineButtonWithIcon";
import SkillsList from "../Skills/SkillsList";
import PrimaryButtonWithIcon from "../../components/PrimaryButtonWithIcon/PrimaryButtonWithIcon";
import ShareIcon from "../../assets/icons/share.svg";
import DownloadIcon from "../../assets/icons/download.svg";
import "./Report.css";

function Report(props) {
  const skills = useSelector((state) => state.skills);
  const projects = useSelector((state) => state.projects);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getSkills());
    dispatch(getProjects());
  }, []);

  let skillsContent = null;
  if (skills.length > 0) {
    console.log(skills);
    // skillsContent = skills.map((skill) => {
    //   return (
    //     <SkillCard key={skill.id} skillName={skill.name} level={skill.level} />
    //   );
    // });
    skillsContent = <SkillsList skills={skills} />;
  } else {
    skillsContent = <div>Loading ...</div>;
  }

  return (
    <div className="report">
      <header className="report-header">
        <h5>My Report</h5>
        <div className="btn-div">
          <PrimaryOutlineButtonWithIcon icon={ShareIcon}>
            Share Report
          </PrimaryOutlineButtonWithIcon>
          <PrimaryButtonWithIcon icon={DownloadIcon} >
            Download Report
          </PrimaryButtonWithIcon>
        </div>
      </header>
      <div className="report-content">
      <h5>Skills</h5>
        <div className="report-skills-div">
          {skillsContent}
        </div>
        </div>
    </div>
  );
}

export default Report;
